import React from 'react';
import './Home.css';

const Home = () => {
  return (
    <div className="home">
      <div className="hero">
        <h1>Welcome to Global Times</h1>
      </div>
      <div className="introduction">
        <p>
          Your source for the latest news and insights. Stay updated with
          the most recent headlines, in-depth analysis, and exclusive
          reports from around the world. Explore the latest in technology,
          sports, entertainment, and more.
        </p>
        <p>
          Check out the <a href="/latest">latest news</a> or add your own
          story on the <a href="/add">Add News</a> page.
        </p>
      </div>
    </div>
  );
};

export default Home;
